#include <time.h>
#include <stdio.h>
#include <unistd.h>
#include <stdlib.h>
#include <sys/socket.h>
#include <bluetooth/bluetooth.h>
#include <bluetooth/rfcomm.h>

int printRandoms(int lower, int upper,
                 int count)
{
    int i, num;
    for (i = 0; i < count; i++)
    {
        num = (rand() %
               (upper - lower + 1)) +
              lower;
        printf("%d ", num);
    }
    return num;
}

int main(int argc, char **argv)
{
char msg[]="";    

    char msg1[]="";

    char msg2[]="";


    struct sockaddr_rc loc_addr = {0}, client_addr = {0};
    char buf[1024] = {0};
    int s, client, bytes_read;
    socklen_t opt = sizeof(client_addr);

    // allocate socket
    s = socket(AF_BLUETOOTH, SOCK_STREAM, BTPROTO_RFCOMM);

    loc_addr.rc_family = AF_BLUETOOTH;
    // loc_addr.rc_bdaddr = *BDADDR_ANY;
    loc_addr.rc_channel = (uint8_t)1;
    bind(s, (struct sockaddr *)&loc_addr, sizeof(loc_addr));

    // put socket into listening mode
    listen(s, 1);

    client = accept(s, (struct sockaddr *)&client_addr, &opt);

    str2ba("18:BB:26:AC:76:95", &loc_addr.rc_bdaddr);
    fprintf(stderr, "%s\n", buf);
    memset(buf, 0, sizeof(buf));
    while (1)
    {
        // read data from the client
        // clock_t start;
        bytes_read = read(client, buf, sizeof(buf));
        char *msg_send = NULL;
        int select = printRandoms(0, 2, 1);
        // int select=0;
        // printf("%f\n",select);
        if (select == 0 && bytes_read > 0)
        {
            printf("%s\n", buf);
            write(client, msg, sizeof(msg));
        }
        else if (select==2)
        {
            printf("%s\n", buf);
            write(client, msg2, sizeof(msg2));
        }
        else {
            printf("%s\n", buf);
            write(client, msg1, sizeof(msg1));
        }
        printf("%s", msg_send);
        // if (bytes_read > 0)
        // {

        // printf("%s\n", buf);
        // start=clock();
        // write(client, msg_send, sizeof(msg_send));
        // }
    }

    // close connection
    close(client);
    close(s);
    clock_t stop = clock();

    // printf("\n%f seconds", (double)(stop - start) / CLOCKS_PER_SEC);
    return 0;
}
